import React, { useEffect, useState} from 'react';
import axios from 'axios';

const ListaPropostas = () => {
  const [loading, setLoading] = useState(true);
  const [dados, setDados] = useState([])
  const itens = ['Item 1', 'Item 2', 'Item 3'];


  useEffect(() => {
    setLoading(true); // Define o estado de loading como true

    fetch('http://localhost:8001/api/campos')
      .then(response => response.json())
      .then(data => {
        setDados(data);

        setLoading(false); // Atualiza o estado de loading para false quando os dados são recebidos
      })
      .catch(error => {
        console.log(error);
        setLoading(true); // Atualiza o estado de loading para false em caso de erro
      });
  }, []);

  return (
    <div>
    {loading && <div>Loading</div>}
    {!loading && (
      <div>
        <h2>Lista</h2>

        {dados.map((i, index)=>(<p>{i}</p>))}
      </div>
    )}
    </div>
  )
}

export default ListaPropostas;
